pragma solidity >=0.4.22 <0.9.0;

contract Tickets{

    struct Ticket{
        address ticketOwner;
    }

    struct Stand{
        uint256 noOfTickets;
        uint256 filledCount;
        uint256 price;
        Ticket[100] tickets;
    }

    struct Match{
        uint256 matchNo;
        string team1;
        string team2;
        string stadium;
        Stand[10] stands;
    }

    Match[10] public matches;

    function setMatch(uint256 _matchno, string memory _team1, string memory _stadium, string memory _team2) public {
        matches[_matchno].matchNo = _matchno;
        matches[_matchno].team1 = _team1;
        matches[_matchno].team2 = _team2;
        matches[_matchno].stadium = _stadium;

    }

    function setStand(uint256 _matchno, uint256 _standNo, uint256 _noOfTickets, uint256 _price) public {
        matches[_matchno].stands[_standNo].price = _price;
        matches[_matchno].stands[_standNo].noOfTickets = _noOfTickets;
        matches[_matchno].stands[_standNo].filledCount = 0;
    }

    function getPrice(uint256 _matchno, uint256 _stand) public view returns(uint256 m){
        m = matches[_matchno].stands[_stand].price;
    }

    function buyTicket(uint256 _matchno, uint256 _stand) external payable returns(uint256){
        uint256 fc = matches[_matchno].stands[_stand].filledCount;
        require(fc!=matches[_matchno].stands[_stand].noOfTickets);
        
        require(msg.value>=matches[_matchno].stands[_stand].price, "Failed");        
        matches[_matchno].stands[_stand].tickets[fc].ticketOwner = msg.sender;
        matches[_matchno].stands[_stand].filledCount = fc + 1; 
        return (fc+1);
    }

    function getFilledCount(uint256 _matchno, uint256 _stand) public view returns(uint256 m){
        m = matches[_matchno].stands[_stand].filledCount;
    }

    function getTotalTickets(uint256 _matchno, uint256 _stand) public view returns(uint256 m){
        m = matches[_matchno].stands[_stand].noOfTickets;
    }

    function getMatch(uint256 _matchno) public view returns(Match memory m){
        m = matches[_matchno];
    }
    // function getMatch(uint256 _matchno) public view returns (Match memory k) {
    //     k = matches[_matchno];
    // }

    // function getTicketOwner(uint256 _matchno, uint256 _seatno) public view returns (address  a){
    //     a = matches[_matchno].matchTickets[_seatno].ticketOwner.customerAddress;
    // }


    // function buyTicket(uint256 _matchno, uint256 _seatno) public {
    //     matches[_matchno].matchTickets[_seatno].ticketOwner.customerAddress = msg.sender;
    // }
}
